while True:
    html = subprocess.check_output(CURL_COMMAND, shell=True)
    soup = BeautifulSoup(html, "html.parser")

    month = soup.find("option", attrs={"selected": "selected"}).text
    daysAvailable = soup.findAll("td", attrs={"class": "DayAvailable"})
    daysSelected = soup.findAll("td", attrs={"class": "SelectedDay"})
    days = daysAvailable + daysSelected

    print(
        "Recieved {} days in {} at {}".format(
            len(days), month, datetime.datetime.utcnow().isoformat()
        )
    )

    if month == MONTH:
        for day in days:
            date = int(day.text)
            if date >= MIN_DAY and date < MAX_DAY:
                for _ in range(3):
                    print()
                    print(
                        "!!! >>> Available day: {:02d} {} <<< !!!".format(date, month)
                    )
                    print()

    time.sleep(11)
